import './App.css';
import axios from 'axios';

function Resort(props) {
    let url = `https://api.openweathermap.org/data/2.5/weather?lat=${props.lat}&lon=${props.long}&appid=${props.appId}&units=imperial`
    const [post, setPost] = React.useState(null)

    React.useEffect(() => {
        axios.get(url).then((response) => {
            setPost(response.data)
        });
    }, []);
    return (
        <div className='Resort'>
            <h1>{props.resortName}</h1>
            <h3>Lat: {props.lat} Long: {props.long}</h3>
        </div>
    );
}

export default Resort;
